update PUBLIC.REALM set ssl_required='NONE' where id = 'master';

CREATE SCHEMA gitfocus;

CREATE TABLE gitfocus.units (
    unit_id numeric(500,0) NOT NULL,
    unit_name character varying(200),
    no_of_repos numeric(500,0),
    unit_owner character varying(200),
    access_token character varying(500)
);




ALTER TABLE ONLY gitfocus.units
    ADD CONSTRAINT pk_unit_id PRIMARY KEY (unit_id);

CREATE TABLE gitfocus.unit_repos (
    unit_id numeric(200,0),
    repo_id numeric(500,0) NOT NULL,
    repo_name character varying(500)
);


ALTER TABLE ONLY gitfocus.unit_repos
    ADD CONSTRAINT pk_repoid PRIMARY KEY (repo_id);


ALTER TABLE ONLY gitfocus.unit_repos
    ADD CONSTRAINT fk_unit_id FOREIGN KEY (unit_id) REFERENCES gitfocus.units(unit_id);

CREATE TABLE gitfocus.teams (
    unit_id numeric(500,0),
    team_id numeric(500,0) NOT NULL,
    team_name character varying(500)
);


ALTER TABLE ONLY gitfocus.teams
    ADD CONSTRAINT pk_team_id PRIMARY KEY (team_id);


ALTER TABLE ONLY gitfocus.teams
    ADD CONSTRAINT fk_unit_id FOREIGN KEY (unit_id) REFERENCES gitfocus.units(unit_id);
CREATE TABLE gitfocus.team_repo (
    unit_id numeric(200,0) NOT NULL,
    team_id numeric(500,0) NOT NULL,
    repo_id numeric(500,0) NOT NULL,
    role character varying(20)
);


ALTER TABLE ONLY gitfocus.team_repo
    ADD CONSTRAINT pk_unit_team_repo PRIMARY KEY (unit_id, team_id, repo_id);


ALTER TABLE ONLY gitfocus.team_repo
    ADD CONSTRAINT fk_repo_id FOREIGN KEY (repo_id) REFERENCES gitfocus.unit_repos(repo_id);


ALTER TABLE ONLY gitfocus.team_repo
    ADD CONSTRAINT fk_team_id FOREIGN KEY (team_id) REFERENCES gitfocus.teams(team_id);

ALTER TABLE ONLY gitfocus.team_repo
    ADD CONSTRAINT fk_unit_id FOREIGN KEY (unit_id) REFERENCES gitfocus.units(unit_id);
CREATE TABLE gitfocus.team_members (
    team_id numeric(500,0) NOT NULL,
    members character varying(500) NOT NULL
);


ALTER TABLE ONLY gitfocus.team_members
    ADD CONSTRAINT pk_team_members PRIMARY KEY (team_id, members);


ALTER TABLE ONLY gitfocus.team_members
    ADD CONSTRAINT fk_team_id FOREIGN KEY (team_id) REFERENCES gitfocus.teams(team_id);

CREATE TABLE gitfocus.branch_details (
    unit_id numeric(100,0) NOT NULL,
    repo_id numeric(100,0) NOT NULL,
    branch_name character varying(100) NOT NULL,
    parent_branch character varying(100)
);




ALTER TABLE ONLY gitfocus.branch_details
    ADD CONSTRAINT "PK_REPO_BRANCH" PRIMARY KEY (unit_id, repo_id, branch_name);


ALTER TABLE ONLY gitfocus.branch_details
    ADD CONSTRAINT "FK_REPO_ID" FOREIGN KEY (repo_id) REFERENCES gitfocus.unit_repos(repo_id);


ALTER TABLE ONLY gitfocus.branch_details
    ADD CONSTRAINT "FK_UNIT_ID" FOREIGN KEY (unit_id) REFERENCES gitfocus.units(unit_id);
	
CREATE TABLE gitfocus.commit_details (
    unit_id numeric(200,0) NOT NULL,
    sha_id character varying(100) NOT NULL,
    repo_id numeric(100,0) NOT NULL,
    branch_name character varying(100) NOT NULL,
    commit_date timestamp(6) without time zone,
    user_id character varying(100),
    message character varying(2000),
    file_name character varying(1000000),
    file_status character varying(1000000),
    lines_added character varying(1000000),
    lines_removed character varying(1000000)
);



