ALTER TABLE ONLY gitfocus.commit_details
    ADD CONSTRAINT "PK_COMMIT_ID" PRIMARY KEY (unit_id, sha_id, repo_id, branch_name);


ALTER TABLE ONLY gitfocus.commit_details
    ADD CONSTRAINT "FK_REPO_BRANCH" FOREIGN KEY (unit_id, repo_id, branch_name) REFERENCES gitfocus.branch_details(unit_id, repo_id, branch_name);


CREATE TABLE gitfocus.pull_master (
    unit_id numeric(100,0),
    repo_id numeric(100,0) NOT NULL,
    pull_id numeric(100,0),
    pull_number numeric(100,0) NOT NULL,
    from_branch character varying(200),
    to_branch character varying(200),
    created_time timestamp(6) without time zone,
    pull_status character varying(50),
    commit_count numeric(100,0),
    user_id character varying(200),
    updated_time timestamp(6) without time zone,
    merged boolean,
    merged_by character varying(100),
    closed_at timestamp(6) without time zone,
    merged_at timestamp(6) without time zone
);





ALTER TABLE ONLY gitfocus.pull_master
    ADD CONSTRAINT "PK_REPO_PULLNO" PRIMARY KEY (repo_id, pull_number);


ALTER TABLE ONLY gitfocus.pull_master
    ADD CONSTRAINT fk_repo_id FOREIGN KEY (repo_id) REFERENCES gitfocus.unit_repos(repo_id);


ALTER TABLE ONLY gitfocus.pull_master
    ADD CONSTRAINT fk_unit_id FOREIGN KEY (unit_id) REFERENCES gitfocus.units(unit_id);



CREATE TABLE gitfocus.pull_commit (
    unit_id numeric(100,0),
    repo_id numeric(100,0) NOT NULL,
    pull_number numeric(100,0) NOT NULL,
    commit_id character varying(200) NOT NULL,
    branch_name character varying(100) NOT NULL
);




ALTER TABLE ONLY gitfocus.pull_commit
    ADD CONSTRAINT "PK_PULL_COMMIT" PRIMARY KEY (repo_id, pull_number, commit_id, branch_name);


ALTER TABLE ONLY gitfocus.pull_commit
    ADD CONSTRAINT "FK_PULL_COMMIT" FOREIGN KEY (unit_id, repo_id, branch_name, commit_id) REFERENCES gitfocus.commit_details(unit_id, repo_id, branch_name, sha_id);

CREATE TABLE gitfocus.review_details (
    unit_id numeric(100,0),
    repo_id numeric(100,0),
    pull_number numeric(100,0),
    review_id numeric(100,0) NOT NULL,
    reviewed_by character varying(100),
    review_comment character varying(1000),
    state character varying(100),
    reviewed_at timestamp(6) without time zone,
    commit_id character varying(100)
);






ALTER TABLE ONLY gitfocus.review_details
    ADD CONSTRAINT "PK_REVIEWID" PRIMARY KEY (review_id);


ALTER TABLE ONLY gitfocus.review_details
    ADD CONSTRAINT fk_repo_pullno FOREIGN KEY (repo_id, pull_number) REFERENCES gitfocus.pull_master(repo_id, pull_number);

